import { FormControl } from '@angular/forms';
import { ValidatorBuilder } from './validator-builder';

export interface IFormBuilder<T extends Record<string, any>> {
  /**
   * Set controller
   * @param pn
   * @param value
   */
  setControl(pn: keyof T, value: FormControl): IFormBuilder<T>;

  /**
   * Get controller
   * @param pn
   * @param value
   */
  getControl(pn: keyof T): FormControl | undefined;

  /**
   * Set validator
   * @param pn
   * @param value
   */
  setValidator(pn: keyof T, vb: ValidatorBuilder<T>): IFormBuilder<T>;

  /**
   * Get validator
   * @param pn
   * @param value
   */
  getValidator(pn: keyof T): ValidatorBuilder;

  /**
   * Add property
   * @param pn
   * @param value
   */
  add(pn: keyof T): ValidatorBuilder<T>;

  /**
   * Initialize controllers
   * @param pn
   * @param value
   */
  init(): IFormBuilder<T>;

  /**
   * Get controllers
   * @param pn
   * @param value
   */
  controls(
    props?: (keyof T)[],
    exclude?: (keyof T)[]
  ): Partial<Record<keyof T, FormControl>>;

  lock(): Pick<IFormBuilder<T>, 'getControl' | 'getValidator' | 'controls'>;
}

export interface IInputOption {
  id: number;
  name: string;
  icon?: string;
  items?: IInputOption[];
}

import { BehaviorSubject, Observable, debounceTime } from 'rxjs';

export interface ILocalStore {
  get(): string | null;
  set(value: string): void;
  remove(): void;
}

export interface LocalStoreOptions {
  debounce?: number;
}

/**
 * Create local storeage if it does not exist
 */
export class LocalStore implements ILocalStore {
  protected static readonly keys = new Set();
  protected readonly $__value = new BehaviorSubject('');
  readonly $value!: Observable<string | null>;

  private constructor(
    protected readonly key: string,
    protected readonly options: LocalStoreOptions
  ) {
    this.$value = this.$__value.pipe(debounceTime(options.debounce ?? 400));
  }

  static createStore(
    key: string,
    options: LocalStoreOptions = { debounce: 400 }
  ) {
    if (this.keys.has(key)) {
      console.warn(`${key} is already used!`);
    }
    this.keys.add(key);
    return new LocalStore(key, options);
  }

  get() {
    return localStorage.getItem(this.key);
  }

  set(value: string) {
    this.$__value.next(value);
    return localStorage.setItem(this.key, value);
  }

  remove() {
    return localStorage.removeItem(this.key);
  }
}

