import { Injectable, Type } from '@angular/core';
import { DateAdapter } from '@angular/material/core';
import {
  DateRange,
  MAT_DATE_RANGE_SELECTION_STRATEGY,
  MatDateRangeSelectionStrategy,
} from '@angular/material/datepicker';

export function createDayRangeSelectionStrategy(daynum: number) {
  @Injectable()
  class ___DayRangeSelectionStrategy<D>
    implements MatDateRangeSelectionStrategy<D>
  {
    constructor(public readonly dateAdaptor: DateAdapter<D>) {}

    selectionFinished(date: D | null): DateRange<D> {
      return this.createRange(date);
    }

    createPreview(activeDate: D | null): DateRange<D> {
      return this.createRange(activeDate);
    }

    public createRange(date: D | null): DateRange<D> {
      if (date) {
        const start = this.dateAdaptor.addCalendarDays(
          date,
          -1 * Math.floor(daynum / 2)
        );
        const end = this.dateAdaptor.addCalendarDays(
          date,
          Math.floor(daynum / 2) - (daynum % 2 == 0 ? 1 : 0)
        );
        return new DateRange<D>(start, end);
      }

      return new DateRange<D>(null, null);
    }
  }

  return ___DayRangeSelectionStrategy;
}

export class DateRangeSelectionStrategies {
  static readonly TEN = createDayRangeSelectionStrategy(10);
  static readonly SEVEN = createDayRangeSelectionStrategy(7);
  static readonly SIX = createDayRangeSelectionStrategy(6);
  static readonly FIVE = createDayRangeSelectionStrategy(5);
  static readonly FOUR = createDayRangeSelectionStrategy(4);
  static readonly THREE = createDayRangeSelectionStrategy(3);
  static readonly TWO = createDayRangeSelectionStrategy(2);
}

export function provideDateRangeSelectionStrategy<T>(
  strategy: Type<MatDateRangeSelectionStrategy<T>>
) {
  return {
    provide: MAT_DATE_RANGE_SELECTION_STRATEGY,
    useClass: strategy,
  };
}

import { Provider } from '@angular/core';
import { AbstractControl, FormGroupDirective, NgForm } from '@angular/forms';
import { ErrorStateMatcher as __ErrorStateMatcher } from '@angular/material/core';

export class ErrorStateMatcher implements __ErrorStateMatcher {
  isErrorState(
    control: AbstractControl<any, any> | null,
    form: FormGroupDirective | NgForm | null
  ): boolean {
    return (control?.dirty && control.touched && !control.valid) ?? false;
  }
}

export function provideErrorStateMatcher(): Provider {
  return {
    provide: __ErrorStateMatcher,
    useClass: ErrorStateMatcher,
  };
}

import { FormControl } from '@angular/forms';
import { ValidatorBuilder } from './validator-builder';
import { IFormBuilder } from './form-builder-interface';

export class FormGroupBuilder<T extends Record<string, any>>
  implements IFormBuilder<T>
{
  private readonly validatorsMap = new Map<keyof T, ValidatorBuilder<T>>();
  private readonly formControlMap = new Map<keyof T, FormControl>();

  constructor(protected readonly formName = 'Form Name') {}

  setControl(propertyName: keyof T, value: FormControl) {
    this.formControlMap.set(propertyName, value);
    return this;
  }

  getControl(propertyName: keyof T): FormControl | undefined {
    return this.formControlMap.get(propertyName);
  }

  setValidator(propertyName: keyof T, validatorBuilder: ValidatorBuilder<T>) {
    this.validatorsMap.set(propertyName, validatorBuilder);

    return this;
  }

  getValidator(propertyName: keyof T): ValidatorBuilder<T> {
    const v = this.validatorsMap.get(propertyName);

    if (!v) throw new Error(`${propertyName.toString()} validator not found`);
    return v;
  }

  add(propertyName: keyof T): ValidatorBuilder<T> {
    const fn = new ValidatorBuilder<T>(propertyName.toString());
    fn.setParent(this);
    this.setValidator(propertyName, fn);
    return fn;
  }

  init(): IFormBuilder<T> {
    for (const [pn, vb] of this.validatorsMap.entries()) {
      const control = new FormControl(null, vb?.build() ?? []);
      this.setControl(pn, control);
    }
    return this;
  }

  /**
   * Create new controls and attach the validators
   * @param properties
   * @returns
   */
  controls(
    properties?: (keyof T)[],
    exclude?: (keyof T)[]
  ): Partial<Record<keyof T, FormControl>> {
    const form: Partial<Record<keyof T, FormControl>> = {};
    for (const [pn, vb] of this.validatorsMap.entries()) {
      if (properties && properties.length > 0 && !properties.includes(pn)) {
        continue;
      }
      if (exclude && exclude.includes(pn)) {
        continue;
      }
      const control = new FormControl(null, vb?.build() ?? []);
      form[pn] = control;
    }
    return form;
  }

  lock(): Pick<IFormBuilder<T>, 'getControl' | 'getValidator' | 'controls'> {
    return this;
  }
}

