import { Directive, ElementRef, OnInit } from '@angular/core';
import { IElementRef } from '../interface';

export const APP_LOGO_PATH = 'assets/icons/icon-72x72.png';
@Directive({
  selector: '[mdtxLogo]',
  standalone: true,
})
export class AppLogoDirective implements IElementRef<HTMLImageElement>, OnInit {
  constructor(public elementRef: ElementRef<HTMLImageElement>) {}

  ngOnInit(): void {
    this.elementRef.nativeElement.classList.add('logo');
    this.elementRef.nativeElement.setAttribute('src', APP_LOGO_PATH);
    this.elementRef.nativeElement.setAttribute('alt', `App Logo`);
  }
}

import { Directive, HostListener, Input } from '@angular/core';
import { IToggleValue } from '../interface';

@Directive({
  selector: '[mdtxFullscreen]',
  standalone: true,
  exportAs: 'mdtxFullscreen',
})
export class FullscreenDirective implements IToggleValue {
  @Input() mdtxFullscreen!: HTMLDivElement;

  @HostListener('click')
  async clickHandler() {
    if (document.fullscreenElement) {
      await document.exitFullscreen();
    } else {
      setTimeout(async () => {
        await this.mdtxFullscreen?.requestFullscreen();
      }, 300);
    }
  }

  isFullscreen() {
    return !!document.fullscreenElement;
  }

  toggleValue<T>(value: T, handsetValue: T): T {
    if (this.isFullscreen()) {
      if (typeof handsetValue == 'function') {
        return handsetValue();
      }
      return handsetValue;
    }
    if (typeof value === 'function') {
      return value();
    }
    return value;
  }
}

import { Directive, ElementRef, HostListener, Input } from '@angular/core';

@Directive({
  selector: '[mdtxInput]',
  standalone: true,
  exportAs: 'mdtxInput',
})
export class InputDirective {
  private __isTyping = false;
  private __typingTimer!: any;
  private __dirty?: boolean;

  @Input() typingDebounceTime = 1000;

  @HostListener('input')
  onInputHandler() {
    this.__dirty = true;
    this.__isTyping = true;
    if (this.__typingTimer) clearTimeout(this.__typingTimer);
    this.__typingTimer = setTimeout(() => {
      this.__isTyping = false;
    }, this.typingDebounceTime);
  }

  constructor(public readonly ref: ElementRef<HTMLInputElement>) {}

  /**
   * Check user is typing into the input field or not
   * @returns boolean
   */
  isTyping() {
    return this.__isTyping;
  }

  /**
   * Check user typed into the input field or not
   * @returns boolean
   */
  isDirty() {
    return this.__dirty;
  }
}

import { Directive, ElementRef, HostListener, Input } from '@angular/core';

@Directive({
  selector: '[mdtxInputFilter]',
  standalone: true,
})
export class InputFilterDirective {
  @Input() mdtxInputFilter!: RegExp;
  @Input() mdtxInputValueFilter!: RegExp;

  private previousValue?: any;
  private actaulValue?: any;

  protected isKeyValid(key: string) {
    return this.mdtxInputFilter.test(key);
  }
  protected isActualValueValid(actualValue: string) {
    return this.mdtxInputValueFilter.test(actualValue);
  }

  @HostListener('keydown', ['$event'])
  keydown(event: KeyboardEvent) {
    // Not required for now!
  }

  @HostListener('keypress', ['$event'])
  keypress(event: KeyboardEvent) {
    const inputKey = event.key;

    if (!this.isKeyValid(inputKey)) {
      event.preventDefault();
      return;
    }
    const actualValue = this.elementRef.nativeElement.value;

    if (this.isActualValueValid(actualValue)) {
      this.previousValue = this.elementRef.nativeElement.value;
    }
  }

  @HostListener('keyup', ['$event'])
  keyup(event: KeyboardEvent) {
    const actualValue = this.elementRef.nativeElement.value;

    if (actualValue)
      if (!this.isActualValueValid(actualValue)) {
        this.elementRef.nativeElement.value = this.previousValue;
        event.preventDefault();
        return;
      }
  }
  constructor(public readonly elementRef: ElementRef<HTMLInputElement>) {}
}

