import {
  Directive,
  ElementRef,
  HostListener,
  Input,
  OnInit,
} from '@angular/core';

@Directive({
  selector: '[mdtxScroll]',
  standalone: true,
})
export class ScrollDirective implements OnInit {
  @Input() mdtxScroll?: 'x' | 'y';

  startX: number | null = null;
  startY: number | null = null;

  @HostListener('mousedown', ['$event'])
  mousedownHandler(event: any) {
    console.log('Mouse down : ', event);
    this.cursorPointer();
    this.startX = event.pageX;
    this.startY = event.pageY;
  }

  @HostListener('mousemove', ['$event'])
  mousemoveHandler(event: any) {
    console.log('Mouse move : ', event);
    if (this.startX !== null && this.startY !== null) {
      const deltaX = this.startX - event.pageX;
      const deltaY = this.startY - event.pageY;

      // If horizontal scroll detected, prevent default vertical scroll behavior
      if (this.mdtxScroll === 'x') {
        if (Math.abs(deltaX) > Math.abs(deltaY)) {
          event.preventDefault();
          this.ref.nativeElement.scrollBy(deltaX, 0);
        }
      } else if (this.mdtxScroll === 'y') {
        // if (Math.abs(deltaX) < Math.abs(deltaY)) {
        event.preventDefault();
        console.log('Scrolling : ', deltaY);
        this.ref.nativeElement.scrollBy(0, deltaY);
        // }
      }

      this.startX = event.pageX;
      this.startY = event.pageY;
    }
  }

  @HostListener('mouseup')
  mouseupHander() {
    console.log('Mouse up : ', event);
    this.cursorDefault();
    this.startX = null;
    this.startY = null;
  }

  constructor(protected readonly ref: ElementRef<HTMLElement>) {}

  protected cursorPointer() {
    if (this.mdtxScroll === 'x') {
      this.ref.nativeElement.style.setProperty('cursor', 'w-resize');
    } else if (this.mdtxScroll === 'y') {
      this.ref.nativeElement.style.setProperty('cursor', 's-resize');
    }
  }
  protected cursorDefault() {
    this.ref.nativeElement.style.setProperty('cursor', 'initial');
  }
  ngOnInit(): void {
    if (!this.mdtxScroll) this.mdtxScroll = 'y';
  }
}

import { Directive, ElementRef, OnDestroy, OnInit } from '@angular/core';
import { Observable, Subscription, map } from 'rxjs';
import { BreakpointObserver, Breakpoints } from '@angular/cdk/layout';
import { IToggleValue } from '../interface';

@Directive({
  selector: '[mdtxViewport]',
  standalone: true,
  exportAs: 'mdtxViewport',
})
export class ViewportDirective implements IToggleValue, OnInit, OnDestroy {
  private __isHandset?: boolean;
  private __isNotHandset?: boolean;
  private __sub!: Subscription;

  private $isHandset: Observable<boolean> = this.media
    .observe([Breakpoints.Handset, Breakpoints.Small, Breakpoints.XSmall])
    .pipe(
      map((e) => {
        const result = e.matches;
        this.__isHandset = result;
        this.__isNotHandset = !this.__isHandset;
        return result;
      })
    );

  constructor(
    public readonly elementRef: ElementRef<HTMLElement>,
    private readonly media: BreakpointObserver
  ) {}

  ngOnInit(): void {
    this.__sub = this.$isHandset.subscribe();
  }

  ngOnDestroy(): void {
    this.__sub.unsubscribe();
  }

  toggleValue<T>(value: T, handsetValue: T): T {
    if (this.__isHandset) {
      if (typeof handsetValue == 'function') {
        return handsetValue();
      }
      return handsetValue;
    }
    if (typeof value === 'function') {
      return value();
    }
    return value;
  }

  isHandset() {
    return this.__isHandset;
  }

  isNotHandset() {
    return this.__isNotHandset;
  }
}

