@Component({
  selector: 'mdtx-table',
  standalone: true,
  imports: [
    CommonModule,
    MatSortModule,
    MatButtonModule,
    MatIconModule,
    MatCheckboxModule,
    MatTableModule,
    MatMenuModule,
  ],
  templateUrl: './table.component.html',
  styleUrl: './table.component.scss',
  animations: [
    slideInDownOnEnterAnimation({
      anchor: 'enter',
      duration: 500,
      delay: 400,
      animateChildren: 'after',
    }),
  ],
})
export class TableComponent<T extends Record<string, any> = any>
  implements OnInit
{
  readonly firstColumns: TableRow<any>[] = [
    { name: 'first' },
    { name: 'second' },
  ];
  readonly lastColumns: TableRow<any>[] = [{ name: 'last' }];
  readonly selectedItems = new Map();

  @Input() columns!: TableRow<T>[];
  @Input() displayedColumns!: TableRow<T>[];
  @Input() dataSource!: any[];
  @Input() conditionalColumn = 'id';
  @Output() selectionChange = new EventEmitter();

  ngOnInit(): void {
    if (this.columns) {
      if (!this.displayedColumns) {
        this.displayedColumns = [
          ...this.firstColumns,
          ...this.columns,
          ...this.lastColumns,
        ];
      } else {
        this.displayedColumns = [
          ...this.firstColumns,
          ...this.displayedColumns,
          ...this.lastColumns,
        ];
      }
    }

    if (!this.dataSource) {
      this.dataSource = [];
    }
  }

  selectItem(event: Partial<MatCheckboxChange>, item: any) {
    if (event.checked) {
      this.selectedItems.set(item.id, item);
    } else {
      this.selectedItems.delete(item.id);
    }
    this.selectionChange.emit(this.selectedItems);
  }

  selectAll(event: Partial<MatCheckboxChange>) {
    if (event.checked) {
      this.dataSource.forEach((e) => {
        this.selectItem(event, e);
      });
    } else {
      this.dataSource.forEach((e) => {
        this.selectItem(event, e);
      });
    }
    this.selectionChange.emit(this.selectedItems);
  }

  isAllSelected() {
    for (const a of this.dataSource) {
      if (!this.selectedItems.get(a.id)) {
        return false;
      }
    }
    return true;
  }

  isPartialSelected() {
    if (this.isAllSelected()) {
      return false;
    }

    return this.selectedItems.size > 0;
  }

  colMetCondition(row: any) {
    return row[this.conditionalColumn] == true;
  }

  colNotMetContion(row: any) {
    return row[this.conditionalColumn] == false;
  }

  getDisplayedColumns() {
    return this.displayedColumns.map((e) => e.name);
  }
}

